We can rewrite the product as:

\begin{align*}
\prod_{n=0}^{\infty}\left(1+\left(\frac{1}{2}\right)^{2^n}\right) &= (1+\left(\frac{1}{2}\right)^{2^0})\cdot(1+\left(\frac{1}{2}\right)^{2^1})\cdot(1+\left(\frac{1}{2}\right)^{2^2})\cdots\\
&= \left(1+\frac{1}{2}\right)\left(1+\frac{1}{4}\right)\left(1+\frac{1}{8}\right)\cdots
\end{align*}

